import React from 'react'
import { Link } from 'react-router-dom';

const MainNavigation = () => {
    const MENU = [
        {
            name: "Contact Us",
            path: "/contact-us",
        },
        {
            name: "FAQ",
            path: "/faqs",
        },
        {
            name: "Gallery",
            path: "/gallery",
        },
    ];
  return (
    <ul>
        { MENU.map( (menuItem, index) => {
            return (
                <li key={index}>
                    <Link to={menuItem.path} className="menu-item"></Link>
                </li>
            )
        })}
    </ul>
  )
}

export default MainNavigation
